import { useState } from "react";
import { ListMovieStyled, SingleMovie } from "./styles";

type TListMovies = {
  movies: Array<any>;
};

const ListMovie = ({ movies }: TListMovies) => {
  return (
    <ListMovieStyled>
      {movies.map((item, index) => (
        <SingleMovie key={index} image={item} />
      ))}
    </ListMovieStyled>
  );
};

export default ListMovie;
